import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar/>
      </header>
    </div>
  );
}

function Navbar() {

  return(
    <div className="navbar">
    <div className="brand-logo">Hello</div>
    <div className="list">
      <ul className="list1">
        <li className="list-item"><a href="#">Home</a></li>
        <li className="list-item"><a href="#">About</a></li>
        <li className="list-item"><a href="#">Project</a></li>
        <li className="list-item"><a href="#">About</a></li>
      </ul>
    </div>
    <div>
      <button className="themebtn">
        Theme
      </button>
    </div>
  </div>
  )
}

export default App;
